import { useEffect } from "react";
import { useState } from "react";

function App() {
  const [questions, setQuestions] = useState([]);
  const [currentQuestion, setCurrentQuestion] = useState(0);
  useEffect(() => {
    getQuestions();
  }, []);

  const getQuestions = async () => {
    const allQuestions = [
      {
        question: "I am a first question",
        answers: ["answer 1", "answer 2", "answer 3", "answer 4"],
        trueAnswer: "answer 2",
      },
      {
        question: "I am a second question",
        answers: ["answer 1", "answer 2", "answer 3", "answer 4"],
        trueAnswer: "answer 3",
      },
      {
        question: "I am a third question",
        answers: ["answer 1", "answer 2", "answer 3", "answer 4"],
        trueAnswer: "answer 4",
      },
    ];
    await setQuestions(allQuestions);
  };
  console.log(questions);
  return (
    <div className="app-container">
      <div className="quiz-box">
        <div className="progress-box">
          <div className="progress-top">
            <div className="progress-texts">
              <h2 className="progress-title">Quiz Progress</h2>
              <p className="prgress-description">Track your quiz progress</p>
            </div>
            <div className="progress-icon">
              <i className="bi bi-bar-chart"></i>
            </div>
          </div>
          <div className="progress-bottom">
            <div
              className="progress-circle"
              aria-valuemin="0"
              aria-valuemax="100"
              style={{ "--value": 77 }}
            >
              <span className="progress-big">8</span>
              <span className="progress-mini">/10</span>
            </div>
            <p className="progress-detail">
              You answered 8 out of 10 questions
            </p>
          </div>
        </div>
        <div className="question-box">
          <div className="question-text">
            <h2 className="question-title">Question: {currentQuestion + 1}</h2>
            <h3 className="question">{questions[currentQuestion].question}</h3>
          </div>
          <div
            className="progress-circle time"
            aria-valuemin="0"
            aria-valuemax="100"
            style={{ "--value": 30 }}
          >
            <span className="time">12</span>
          </div>
        </div>

        <div className="answers-boxes">
          {questions[currentQuestion].answers.map((answer, index) => {
            return (
              <label htmlFor={index} className="anser-label selected">
                {answer}
                <input type="radio" name="answer" id={index} />
              </label>
            );
          })}
          <label htmlFor="answer1" className="anser-label selected">
            seç
            <input type="radio" name="answer" id="answer1" />
          </label>
          <label htmlFor="answer2" className="anser-label">
            seç
            <input type="radio" name="answer" id="answer2" />
          </label>
          <label htmlFor="answer3" className="anser-label">
            seç
            <input type="radio" name="answer" id="answer3" />
          </label>
          <label htmlFor="answer4" className="anser-label">
            seç
            <input type="radio" name="answer" id="answer4" />
          </label>
        </div>

        <div className="message">
          <div className="icon">
            <i className="bi bi-exclamation-triangle"></i>
          </div>
          <span>You must choose an answer!</span>
        </div>
        <div className="message animation">
          <div className="icon">
            <i className="bi bi-exclamation-triangle"></i>
          </div>
          <span>You must hurry up!</span>
        </div>
      </div>
    </div>
  );
}

export default App;
